import React from 'react';
import { Routes, Route, Link } from 'react-router-dom'; // Usamos Routes en lugar de Switch
import './App.css'; // Asegúrate de tener los estilos correspondientes
import logo from './img/logo.png'; // Asegúrate de que la ruta sea correcta

// Componentes de ejemplo (puedes reemplazarlos con los tuyos)
import Home from './components/Home';
import Catalog from './components/Catalog';
import Gallery from './components/Gallery';
import Login from './components/Login';

function App() {
  return (
    <div className="App">
      <nav className="navbar">
        <div className="navbar-logo">
          <Link to="/">
            <img src={logo} alt="Logo" className="logo" />
          </Link>
        </div>
        <div className="navbar-links">
          <Link to="/">Inicio</Link>
          <Link to="/catalog">Catálogo</Link>
          <Link to="/gallery">Galería</Link>
          <Link to="/login">Iniciar sesión</Link>
        </div>
      </nav>

      {/* Rutas definidas usando Routes y Route */}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/catalog" element={<Catalog />} />
        <Route path="/gallery" element={<Gallery />} />
        <Route path="/login" element={<Login />} />
      </Routes>
    </div>
  );
}

export default App;
